//canvas should be square and take up as much space as possible. Will resize when refreshed.
const canvas = document.getElementById("canvas");
const ctx = canvas.getContext("2d");
canvas.width = 700;
canvas.height = 700;

let fpsInterval, now, then, elapsed, fpsDisplay; //variables for animation loop
const keys = []; //holds all current keypresses
let zoom = 0.5;
const track = new Image();
//data:image/png;base64,
track.src = "data:image/png;base64,";
const trackWidth = 3000;
let boatCam = true;
let collisionMap = [];
let trackData;
let iceFric = 0.995;
let iceAngFric = 0.99;
let grassFric = 0.9;
let grassAngFric = 0.9;
let checkpoints = [];
let totalCp = 10;
let startTime;
let startText = 0;
let active = false;
let lastTime = 0;
let bestTime = localStorage.getItem("bestTime");
if (bestTime == null) bestTime = 0;

track.onload = () => {
    const offCanvas = document.createElement("canvas");
    offCanvas.width = trackWidth;
    offCanvas.height = trackWidth;
    const offCtx = offCanvas.getContext("2d");
    offCtx.imageSmoothingEnabled = false;
    offCtx.drawImage(track, 0, 0);
    trackData = offCtx.getImageData(0, 0, trackWidth, trackWidth);
    generateCollisionMap();
}

function generateCollisionMap() {
    for (let y = 0; y < trackWidth; y++) {
        let row = [];
        for (let x = 0; x < trackWidth; x++) {
            const index = (y * trackWidth + x) * 4;
            const r = trackData.data[index];
            const g = trackData.data[index + 1];
            const b = trackData.data[index + 2];

            if (r >= 85 && r <= 100 && g >= 250 && b >= 235 && b <= 245) { //ice
                row.push(1);
            } else if (r >= 250 && g >= 250 && b >= 250)  { //finish line
                row.push(2);
            } else if (r <= 5 && g >= 126 && g <= 137 && b >= 210 && b <= 220) { //checkpoint
                row.push(3);
            } else { // grass
                row.push(0);
            
            }
        }
        collisionMap.push(row);
    }
}

class Checkpoint {
    constructor(x, y) {
        this.x = x;
        this.y = y;
        this.radius = 300;
    }
}

class Boat {
    constructor() {
        this.width = 40;
        this.height = 30;
        this.angle = 3 * Math.PI / 2;
        this.angVel = 0;
        this.angAcc = Math.PI / 1200;
        this.xPos = 352;
        this.yPos = 1470;
        this.xVel = 0;
        this.yVel = 0;
        this.acc = 0.07;
        this.maxSpeed = 7;
        this.maxAngVel = Math.PI / 30;
        this.fric = iceFric;
        this.angFric = iceAngFric;
    }
    update() {
        //change angular velocity
        if (keys["KeyA"]) (this.angVel >= -this.maxAngVel) ? this.angVel -= this.angAcc : this.angVel = -this.maxAngVel;
        if (keys["KeyD"]) (this.angVel <= this.maxAngVel) ? this.angVel += this.angAcc : this.angVel = this.maxAngVel;
        if (Math.abs(this.angVel) < Math.PI / 2000) this.angVel = 0; else this.angVel *= this.angFric;
        //change translational velocity
        if (keys["KeyW"]) {
            this.xVel += this.acc * Math.cos(this.angle);
            this.yVel += this.acc * Math.sin(this.angle);
            let speed = Math.sqrt(this.xVel * this.xVel + this.yVel * this.yVel); //normalizing max speed
            if (speed > this.maxSpeed) {
                this.xVel *= this.maxSpeed / speed;
                this.yVel *= this.maxSpeed / speed;
            }
        }
        let speed = Math.sqrt(this.xVel * this.xVel + this.yVel * this.yVel);
        if (speed < 0.05) {
            this.xVel = 0;
            this.yVel = 0;
        } else {
            this.ihat = this.xVel / speed; //normalize friction
            this.jhat = this.yVel / speed;
            speed *= this.fric;
            this.xVel = this.ihat * speed;
            this.yVel = this.jhat * speed;
        }

        //update rotation and position
        this.angle += this.angVel;
        this.xPos += this.xVel;
        this.yPos += this.yVel;

        //console.log(this.xPos + ", " + this.yPos);

        //update friction based on collisionMap Treats boat as point-mass, not a rectangle. Marked with dot on screen.
        if (collisionMap[Math.floor(this.yPos)][Math.floor(this.xPos)] == 0) {
            this.fric = grassFric;
            this.angFric = grassAngFric;
        } else {
            this.fric = iceFric;
            this.angFric = iceAngFric;
        }
        //check for checkpoints, if one is found, add location to prevent re-checking
        if (collisionMap[Math.floor(this.yPos)][Math.floor(this.xPos)] == 3) {
            let newCp = true;
            for (let i = 0; i < checkpoints.length; i++) {
                if (Math.sqrt((this.xPos - checkpoints[i].x)**2 + (this.yPos - checkpoints[i].y)**2) < checkpoints[i].radius) {
                    newCp = false;
                }
            }
            if (newCp) {
                checkpoints.push(new Checkpoint(Math.floor(this.xPos), Math.floor(this.yPos)));
            }
        }
        //check for finish line, end lap is found
        if (collisionMap[Math.floor(this.yPos)][Math.floor(this.xPos)] == 2 && checkpoints.length == totalCp) {
            currentTime = Date.now();
            //console.log(startTime);
            //console.log(currentTime - startTime);
            if (currentTime - startTime < bestTime || bestTime == 0) {
                bestTime = currentTime - startTime;
                localStorage.setItem("bestTime", bestTime);
            }
            lastTime = currentTime - startTime;
            prepareLap();
        }
    }
    draw() { //drawing a rotated boat involves rotating and restoring the entire canvas
        ctx.save();
        ctx.translate(canvas.width / 2, canvas.height / 1.2);
        if (boatCam) {
            let speedAngle = Math.atan2(this.yVel, this.xVel);
            if (Math.sqrt(this.xVel * this.xVel + this.yVel * this.yVel) < 0.1) ctx.rotate(Math.PI * 3 / 2);
            else ctx.rotate(Math.PI * 3 /2 + this.angle - speedAngle);
        } else ctx.rotate(Math.PI * 3 / 2);
        ctx.fillStyle = "#8a5500ff";
        ctx.fillRect(-this.width / 2, -this.height / 2, this.width, this.height);
        ctx.beginPath();
        ctx.fillStyle = "rgba(72, 39, 0, 1)";
        ctx.arc(0, 0, 3, 0, Math.PI * 2);
        ctx.fill();
        ctx.restore();
    }
}
const boat = new Boat(); //initialize the player

function camera() {
    ctx.save();
    ctx.translate(canvas.width / 2, canvas.height / 1.2);
    if (boatCam) {
        let speedAngle = Math.atan2(boat.yVel, boat.xVel);
        if (Math.sqrt(boat.xVel * boat.xVel + boat.yVel * boat.yVel) < 0.1) speedAngle = boat.angle;
        ctx.rotate(-speedAngle + Math.PI * 3 /2);
    } else ctx.rotate(Math.PI * 3 / 2 - boat.angle);
    ctx.drawImage(track, boat.xPos - zoom * trackWidth / 2, boat.yPos - zoom / 2 * trackWidth, zoom * trackWidth, zoom * trackWidth, -canvas.width, -canvas.height, canvas.width*2, canvas.height*2);
    ctx.restore();
}

function overlays() {
    //camera view
    ctx.fillStyle = "black";
    ctx.textAlign = "left";
    ctx.textBaseline = "top";
    ctx.font = "20px Verdana";
    ctx.fillText("View (B): " + ((boatCam) ? "Boat Cam" : "Vanilla Cam"), 5, 5);

    //frame rate
    /*ctx.textAlign = "right";
    ctx.textBaseline = "bottom";
    ctx.fillText(fpsDisplay + " FPS", canvas.width - 10, canvas.height - 10);*/

    //start text
    if (startText == 1) {
        ctx.textAlign = "center";
        ctx.textBaseline = "center";
        ctx.font = "30px Verdana";
        ctx.fillText("SET", canvas.width / 2, canvas.height / 2);
    } else if (startText == 2) {
        ctx.textAlign = "center";
        ctx.textBaseline = "center";
        ctx.font = "30px Verdana";
        ctx.fillText("GO", canvas.width / 2, canvas.height / 2);
    }

    //current, last, and best times
    ctx.textAlign = "left";
    ctx.textBaseline = "top";
    ctx.font = "20px Verdana";
    let timeRaw, timeMin, timeSec;
    if (active) {
        currentTime = Date.now();
        timeRaw = (currentTime - startTime) / 1000;
        timeMin = Math.floor(timeRaw / 60);
        timeSec = timeRaw % 60;
        ctx.fillText("Current: " + timeMin + ":" + timeSec.toFixed(2), canvas.width - 180, 10);
    }
    timeRaw = lastTime / 1000;
    timeMin = Math.floor(timeRaw / 60);
    timeSec = timeRaw % 60;
    ctx.fillText("Last: " + timeMin + ":" + timeSec.toFixed(2), canvas.width - 145, 35);

    timeRaw = bestTime / 1000;
    timeMin = Math.floor(timeRaw / 60);
    timeSec = timeRaw % 60;
    ctx.fillText("Best: " + timeMin + ":" + timeSec.toFixed(2), canvas.width - 147, 60);
}

function prepareLap() {
    active = false;
    boat.xPos = 352;
    boat.yPos = 1470;
    boat.xVel = 0;
    boat.yVel = 0;
    boat.angle = Math.PI * 3 / 2;
    boat.angVel = 0;
    startText = 1;
    timer = 0;
    checkpoints = [];
    setTimeout(() => {
        startText = 2;
        startLap();
    }, 1000);
}

function startLap() {
    active = true;
    startTime = Date.now();
    setTimeout(() => {
        startText = 0;
    }, 1000);
}

//put keypresses into keys list
window.addEventListener("keydown", (e) => {
    keys[e.code] = true;
});
window.addEventListener("keyup", (e) => {
    keys[e.code] = false;
});
window.addEventListener("keypress", (e) => { // toggle camera view
    if (e.code == "KeyB") boatCam = !boatCam;
});
window.addEventListener("keypress", (e) => {
    if (e.code == "KeyR") {
        prepareLap();
    }
});

function animate() { //animate at the same fps regardless of computer performance
    requestAnimationFrame(animate);
    now = Date.now();
    elapsed = now - then;
    if (elapsed > fpsInterval) {
        then = now - (elapsed % fpsInterval);
        fpsDisplay = Math.round(1000 / elapsed);

        //animation code
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        camera();
        if (active) boat.update();
        boat.draw();
        overlays();
    }
}

function startAnimating(fps) {
    fpsInterval = 1000 / fps;
    then = Date.now();
    animate();
}

//start loop
startAnimating(60);
prepareLap();